function processCsv(data) {
	var minTurnout = 100, maxTurnout = 0;

	//Assembly constituencies
	var choroMap = {};
	var newData = $.csv.toArrays(data);
	var rows = newData.length;
	var cols = newData[0].length;
	for(var i=0; i < rows; i++) {
		choroMap[newData[i][0]]= newData[i][2];
		choroMap[newData[i][0]+'title']= newData[i][1];
		if(newData[i][2] < minTurnout) {
			minTurnout = newData[i][2];
		}
		if(newData[i][2] > maxTurnout) {
			maxTurnout = newData[i][2];
		}
	}

	rsr.forEach(function (el) {
		var fraction = 0;
		if(typeof choroMap[el.data('id')] != 'undefined') {
			fraction = ((choroMap[el.data('id')] - minTurnout)/(maxTurnout - minTurnout));
			var b = 0;
			var g = 0;
			var r = 255*fraction;
			el.attr({fill: "rgb("+r+", "+g+", "+b+")" });
			el.attr({title: choroMap[el.data('id')+'title'] });
		} else {
			el.attr({fill: "rgb(255, 255, 255)" });
		}
	});
}


function updateMap() {
	var getStr = 'dataVendor.php?detail='+$("input[name=detailgroup]:checked", "#detail").val()+'&dataset='+$("input[name=datasetgroup]:checked", "#dataset").val()+'&type='+$("input[name=typegroup]:checked", "#type").val();
	//alert(getStr);
	$.get(getStr, processCsv , dataType='text');
	rsr.setViewBox(100, 600, 2300, 2300, true);
}

$("input[name='detailgroup']").change(function(e){
	updateMap();
});
$("input[name='datasetgroup']").change(function(e){
	updateMap();
});
$("input[name='typegroup']").change(function(e){
	updateMap();
});

updateMap();

});
